import React from 'react';
import '../Header/Header.css';
import prog from '../../assert/prog.jpeg';



const Header = () => {
  return (
    <div className='header-Container'>
        <div className='header-img'>
         <img src={prog} alt='programming' />
        </div>
    </div>
  )
}

export default Header
